import React, { useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes, useNavigate } from 'react-router-dom';
import Main from './Component/Main';
import Services from './Component/services';
import AboutUs from './Component/about_us';
import PastWork from './Component/past_work';
import ContactUs from './Component/contact_us';
import './Component/style.css';

function App() {
  const navigate = useNavigate();

  useEffect(() => {
    // Navigate to the main page when the component mounts
    navigate('/Main');
  }, [navigate]);

  return (
    <Router>
      <>
        <Routes>
          <Route path="/Main" element={<Main />} />
          <Route path="/services" element={<Services />} />
          <Route path="/about-us" element={<AboutUs />} />
          <Route path="/past_work" element={<PastWork />} />
          <Route path="/contact_us" element={<ContactUs />} />
        </Routes>
      </>
    </Router>
  );
}

export default App;
